import React, { Component } from "react"

class UserList extends Component{
            deleteUser = (id) => {
                console.log(id)
    }
    
    render() {
        const { users } = this.props;
        return (
            <table className="table">
  <thead>
    <tr>
      <th scope="col">Id</th>
      <th scope="col">Name</th>
      <th scope="col">Job</th>
      <th scope="col">Action</th>
    </tr>
  </thead>
  <tbody>
                    {users.map(user => {
                        return (
                            <tr>
                            <th scope="row">{user.id}</th>
                            <td>{user.name}</td>
                            <td>{user.job}</td>
                            <td><button className="btn btn-danger" onClick={this.deleteUser} key={user.id}>Delete</button></td>
                            </tr>
                        )
                    })}
  </tbody>
</table>
        )
    }
}

export default UserList;
